import React from 'react'
import '../NavBar.css'

import {useHistory} from 'react-router'

import Typography from '@material-ui/core/Typography';
import Breadcrumbs from '@material-ui/core/Breadcrumbs';
import Link from '@material-ui/core/Link';

import {background} from '.../public/nav-img.png'

export default function NavBar() {

    const history = useHistory()

    const pushToHome = () => {
        history.push('/')
    } 

    return (
        <div>
            <nav style={{backgroundImage:`url(${background})`}}>
            <Breadcrumbs aria-label="breadcrumb">

            <Typography color="textPrimary"><h3 onClick={pushToHome}>noteTaker</h3></Typography>
            <Link color="inherit" href="/new">New Note</Link>
            <Link color="inherit" href="/login">Sign Out</Link>

            </Breadcrumbs>
            </nav>
        </div>
    )
}
